import * as React from "react";
import logo from "../../logo.svg";
import { Navbar, Container, Form, Nav } from "react-bootstrap";

import { FaLanguage, FaMapMarkerAlt } from "react-icons/fa";
import { Avatar, Paper, IconButton, InputBase } from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";

const navbarHome2 = () => {
  return (
    <Navbar expand="lg" id="navbardb2">
      <Container fluid>
        <Navbar.Brand href="/In">
          <img src={logo} alt="Logo" />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: "100px" }}
            navbarScroll
          ></Nav>
          <Paper
            component="form"
            sx={{
              p: "2px 4px",
              display: "flex",
              alignItems: "center",
              width: 400,
              position: "absolute",
              left: 450,
              borderRadius:20,
              backgroundColor:"#FBFBFB",
              boxShadow:"none"
            }}
          >
            {/* <IconButton type="submit" sx={{ p: "10px",color:"#034D82" }} aria-label="search">
              <SearchIcon />
            </IconButton> */}
            <InputBase
              sx={{ ml: 1, flex: 1 }}
              placeholder="Search"
              inputProps={{ "aria-label": "search google maps" }}

            />
          </Paper>

          <Form className="d-flex">
            <div className="box4">
              <FaLanguage size="28px" color="#034D82" />
              <h6 style={{ paddingTop: 10, marginLeft: 10 }}>EN</h6>
            </div>
            <div className="box4">
              <FaMapMarkerAlt size="20px" color="#034D82" />
              <h6 style={{ paddingTop: 10, marginLeft: 10 }}>US</h6>
            </div>
            <div className="box4" style={{ width: 40 }}>
              <Avatar
                alt="avatar"
                src={require("../../Images/Avatar2.png")}
                id={"avatar3"}
                style={{ width: "98%" }}
              />
            </div>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};
export default navbarHome2;
